import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { useAuth } from '../contexts/AuthContext';

const RegisterPage = () => {
  const navigate = useNavigate();
  const { register } = useAuth();

  const [form, setForm] = useState({
    name: '',
    email: '',
    phone: '',
    password: '',
    address: {
      region: '',
      city: '',
      subcity: '',
      woreda: '',
      kebele: '',
      houseNumber: '',
      specificLocation: ''
    }
  });

  const [submitting, setSubmitting] = useState(false);

  const onChange = (e) => {
    const { name, value } = e.target;
    if (name.startsWith('address.')) {
      const key = name.split('.')[1];
      setForm((s) => ({ ...s, address: { ...s.address, [key]: value } }));
    } else {
      setForm((s) => ({ ...s, [name]: value }));
    }
  };

  const validate = () => {
    if (!form.name.trim()) return 'Name is required';
    if (!form.email.match(/^[^\s@]+@[^\s@]+\.[^\s@]+$/)) return 'Valid email is required';
    if (!form.phone.trim()) return 'Phone is required';
    if (!form.password || form.password.length < 6) return 'Password (min 6 chars) is required';
    return null;
  };

  const onSubmit = async (e) => {
    e.preventDefault();
    const err = validate();
    if (err) return toast.error(err);
    setSubmitting(true);
    try {
      const payload = { ...form };
      const res = await register(payload);
      if (res.success) {
        toast.success('Registration successful');
        navigate('/login');
      } else {
        toast.error(res.message || 'Registration failed');
      }
    } catch (error) {
      toast.error(error.message || 'Registration failed');
    } finally {
      setSubmitting(false);
    }
  };

  return (
    <div style={{ maxWidth: 720, margin: '2rem auto', padding: 20 }}>
      <ToastContainer />
      <h2>Register</h2>
      <form onSubmit={onSubmit}>
        <div>
          <label>Name</label>
          <input name="name" value={form.name} onChange={onChange} className="form-control" />
        </div>

        <div>
          <label>Email</label>
          <input name="email" value={form.email} onChange={onChange} className="form-control" />
        </div>

        <div>
          <label>Phone</label>
          <input name="phone" value={form.phone} onChange={onChange} className="form-control" placeholder="e.g. +251911223344" />
        </div>

        <div>
          <label>Password</label>
          <input name="password" value={form.password} onChange={onChange} type="password" className="form-control" />
        </div>

        <fieldset style={{ marginTop: 12 }}>
          <legend>Address (optional)</legend>
          <div>
            <label>Region</label>
            <input name="address.region" value={form.address.region} onChange={onChange} className="form-control" />
          </div>
          <div>
            <label>City</label>
            <input name="address.city" value={form.address.city} onChange={onChange} className="form-control" />
          </div>
          <div>
            <label>Subcity</label>
            <input name="address.subcity" value={form.address.subcity} onChange={onChange} className="form-control" />
          </div>
          <div>
            <label>Woreda</label>
            <input name="address.woreda" value={form.address.woreda} onChange={onChange} className="form-control" />
          </div>
          <div>
            <label>Kebele</label>
            <input name="address.kebele" value={form.address.kebele} onChange={onChange} className="form-control" />
          </div>
          <div>
            <label>House Number</label>
            <input name="address.houseNumber" value={form.address.houseNumber} onChange={onChange} className="form-control" />
          </div>
          <div>
            <label>Specific Location</label>
            <input name="address.specificLocation" value={form.address.specificLocation} onChange={onChange} className="form-control" />
          </div>
        </fieldset>

        <div style={{ marginTop: 12 }}>
          <button className="btn btn-primary" type="submit" disabled={submitting}>
            {submitting ? 'Registering...' : 'Register'}
          </button>
        </div>
      </form>
    </div>
  );
};

export default RegisterPage;
